import React, {useState} from 'react'
import sobe from '../images/icon-sobe.png'
import desce from '../images/icon-desce.png'

export const Informacoes = (props) => {

    const subir = () => {props.subir}
    
    const descer = () => {props.descer}

    return (
        <div className="container-informacoes" >
            <h3>{props.titulo}</h3>
            {props.texto}

            <div className="navegacao">
              <img className='navegacao-img sobe' src={sobe} onClick={subir}/>
              <img className='navegacao-img desce' src={desce} onClick={descer} />
            </div> 
        </div>
    )
}
